import "./Boton.css"
export default function Boton ({clickHandler, name, blue, green, gray,whide }) {

    const handleClick = () => clickHandler(name)

    const className = [
        "componet-button",
        green ? "green" : "",
        gray ? "gray" : "",
        blue ? "blue" : "",
    ]
    return(
        <div className={className.join(" ").trim()}>
            <button className="btn" onClick={handleClick}>{name}</button>
        </div>
    )
}
